Valhalla 12 - Through fire and water
Loki and Odin have gone to Bjarmland to find out why the Bjarmar people have stopped sacrificing to the gods. They meet the cruel King Geirrod and his two ugly jotunns daughters, Gjalp and Greip, and before long our two friends are in for it!
Geirrods alliance with the jotunns is a dangerous combination that makes even the might of the gods insufficient. But once Loki gets a chance to seek help from Thor, things brighten up a little ... or do they? It turns out that Thor has forgotten his hammer - will he be bright enough to do without it?
